import React, { Component } from 'react'
import TimeButton from './timeButton';
export default class TopBar extends Component {

  constructor() {
    super() 
    this.state = {
      active: '0'
    }
  }



  render() {
    return (
      <div className="topbar">
        <div className="container">
        <div className="topBar">
        <TimeButton mins={'15'} className={this.state.active ? 'btn-active': 'btn'} 
        onClick={this.toggleClass}></TimeButton>
        <TimeButton mins={'30'} className="btn"></TimeButton>
        <p className="topBar_title">select time</p>
        <TimeButton mins={'45'} className="btn"></TimeButton>
        <TimeButton mins={'60'} className="btn"></TimeButton>
        </div>
        </div>
      </div>
    )
  }
}
